「4D NANO DESIGN」を駆使し、発熱を抑制することで転がり抵抗を低減。
また、「新配合」と「新パターン」採用により、優れた耐摩耗性能を実現し経済性を向上。
2種類のパターンと豊富なサイズラインアップで、幅広いユーザーに応える
大好評の長持ちする低燃費タイヤ。<style type="text/css">

